import React from 'react';


export default class CountUp extends React.Component{
    render(){
        return(
            <div className="playholder" class="container-fluid">
            <h2>{props.name}</h2>
            <h2>{props.github}</h2>
            <h2>{props.phone}</h2>
            <h2>{props.email}</h2>
            </div>
        )
    }

}
